tables.table_schema:
CREATE TABLE Payroll_Taxes (
    employee_id INT,
    salary DECIMAL,
    federal_tax DECIMAL,
    state_tax DECIMAL
);

CREATE TABLE payroll_employee (
    employee_id INT PRIMARY KEY,
    employee_name VARCHAR,
    salary DECIMAL,
    tax_rate DECIMAL
);

CREATE TABLE payroll_tax (
    tax_id INT PRIMARY KEY,
    tax_name VARCHAR,
    tax_rate DECIMAL,
    tax_category VARCHAR
);

CREATE TABLE employees (
    employee_id INT PRIMARY KEY,
    employee_name VARCHAR(50) NOT NULL,
    employee_salary DECIMAL(10, 2) NOT NULL
);

CREATE TABLE tax_rates (
    tax_id INT PRIMARY KEY,
    tax_rate DECIMAL(4, 2) NOT NULL,
    tax_description TEXT
);

CREATE TABLE payroll_info (
    payroll_id INT PRIMARY KEY,
    employee_id INT NOT NULL,
    gross_salary DECIMAL(10, 2) NOT NULL,
    net_salary DECIMAL(10, 2) NOT NULL
);

CREATE TABLE employees (
  employee_id INT PRIMARY KEY,
  employee_name VARCHAR(50) NOT NULL,
  salary DECIMAL(10,2) NOT NULL,
  tax_rate DECIMAL(4,2) NOT NULL
);

CREATE TABLE tax_brackets (
  bracket_id INT PRIMARY KEY,
  bracket_min DECIMAL(10,2) NOT NULL,
  bracket_max DECIMAL(10,2) NOT NULL,
  tax_rate DECIMAL(4,2) NOT NULL
);

CREATE TABLE tax_calculations (
  calculation_id INT PRIMARY KEY,
  employee_id INT NOT NULL,
  calculation_date DATE NOT NULL,
  tax_amount DECIMAL(10,2) NOT NULL
);

CREATE TABLE Employee (
    employee_id INT PRIMARY KEY,
    employee_name VARCHAR(255),
    salary DECIMAL(10,2),
    tax_rate DECIMAL(4,2)
);

CREATE TABLE Payroll (
    payroll_id INT PRIMARY KEY,
    employee_id INT,
    payment_date DATE,
    net_pay DECIMAL(10,2)
);

CREATE TABLE TaxRates (
    tax_rate_id INT PRIMARY KEY,
    tax_bracket VARCHAR(50),
    income_start DECIMAL(10,2),
    income_end DECIMAL(10,2),
    tax_percentage DECIMAL(4,2)
);

CREATE TABLE TaxCalculation (
    calculation_id INT PRIMARY KEY,
    employee_id INT,
    payroll_id INT,
    gross_income DECIMAL(10,2),
    tax_amount DECIMAL(10,2)
);

CREATE TABLE EmployeeLogs (
    log_id INT PRIMARY KEY,
    employee_id INT,
    log_date DATE,
    log_message TEXT
);
